import React from 'react';
import './ToggleButton.css';

const ToggleButton = ({ active, onClick, children }) => (
  <button
    className={`primary-btn ${active ? 'primary-btn-active' : ''}`}
    onClick={onClick}
    type="button"
  >
    {children}
  </button>
);

export default ToggleButton;
